return {
  responsive: true,
  maintainAspectRatio: false,
  interaction: {
    mode: 'index',
    intersect: false,
  },
  layout: {
    padding: { top: 20, bottom: 10, left: 10, right: 10 }
  },
  plugins: {
    legend: {
      position: 'top',
      align: 'end',
      labels: {
        usePointStyle: true,
        boxWidth: 6,
        padding: 20,
        color: text, 
        font: { 
          size: 11, 
          family: "'Space Grotesk', sans-serif", // <--- AQUI (Space Grotesk)
          weight: 500
        }
      }
    },
    tooltip: {
      enabled: true,
      backgroundColor: card,
      titleColor: title,
      bodyColor: text,
      borderColor: border,
      borderWidth: 1,
      padding: 12,
      cornerRadius: 6,
      displayColors: true,
      boxPadding: 4,
      usePointStyle: true,
      titleFont: {
        family: "'Space Grotesk', sans-serif", // <--- AQUI (Título do Tooltip)
        size: 13
      },
      bodyFont: {
        family: "'Space Grotesk', sans-serif", // <--- AQUI (Texto do Tooltip)
        size: 12
      },
      callbacks: {
        label: function(context) {
          let label = context.dataset.label || '';
          if (label) label += ': ';
          if (context.parsed.y !== null) {
            label += new Intl.NumberFormat('pt-BR').format(context.parsed.y);
          }
          return label;
        }
      }
    }
  },
  scales: {
    x: {
      grid: { display: false, drawBorder: false },
      ticks: {
        color: text,
        font: { 
          size: 10, 
          family: "'Space Grotesk', sans-serif" // <--- AQUI (Eixo X - Dias)
        },
        maxRotation: 0,
        autoSkip: true,
        maxTicksLimit: 8
      }
    },
    y: {
      beginAtZero: true,
      border: { display: false },
      grid: {
        color: border,
        lineWidth: 1,
        borderDash: [4, 4],
        drawBorder: false,
        tickLength: 0
      },
      ticks: {
        color: text,
        padding: 10,
        font: { 
          size: 10, 
          family: "'Space Grotesk', sans-serif" // <--- AQUI (Eixo Y - Números)
        },
        callback: function(val) {
          if (val >= 1000) return (val / 1000) + 'k';
          return val;
        }
      }
    }
  },
  elements: {
    line: {
      borderWidth: 1
    }
  }
}

